import React from 'react';
import "./Tri.css";

function Tri() {

    function tritop(e) {
        e.target.style.background = 'red';
      }

    function tritopl(e) {
        e.target.style.background = 'green';
      }

    return (  
        <div>
            <div>
                <div className="d-flex justify-content-center">
                    
                    <img src={require(`./images/bg.png`)} className="triselecter"/>
                </div>
                <div>

                <button onMouseOver={tritop} onMouseLeave={tritopl}>
                    <img src={require(`./images/top.png`)} className="tritop"/>
                </button>

                <button onMouseOver={triright} onMouseLeave={triright}>
                    <img src={require(`./images/right.png`)} className="triright"/> </button>
                    <img src={require(`./images/left.png`)} className="trileft"/>
                    <img src={require(`./images/bot.png`)} className="tribot"/>
                </div>


                <div className="plex">
                    <p>Yolo</p>
                </div>
            </div>

        </div>
    );

}

export default Tri;
